import "./App.css";
import images from './Components/images'

import NavBar from './Components/NavBar'


function App() {
  return (
    <div>
      <h1> Tienda Flamenco </h1>
      <NavBar />
      <h2> Camisetas </h2>
      <section className="cards">
        <figure className="card">
          <img src={images.img1} alt="pain harold"></img>
        </figure>
        <figure className="card">
          <img src={images.img1} alt="pain harold"></img>
        </figure>
      </section>
      <hr />
      <h2> Zapatillas </h2>
    </div>
  );
}

export default App;
